import { Container,Row, Col } from "react-bootstrap";

const Footer = () => {
    const currentYear = new Date().getFullYear();
    return ( 
        <footer>
            <Container>
                <Row>
                    <Col>
                        <p>Your Company. All rights reserved.&copy; {currentYear}</p>
                    </Col>
                </Row>
            </Container>
        </footer>
     );
}

export default App;
